import React, { useState, useEffect} from "react";
import { getUsers } from "../api";

function Liste() {

    const [users, setUsers] = useState([]);

    useEffect(() => {
        getAllUsers();
    }, []);

    const getAllUsers = async () => {
        let response = await getUsers();
        setUsers(response.data);
    }
    return (
        <div>

    <table>
        <tbody>
            <tr>
                <th>Prenom</th>
                <th>Nom</th>
                <th>Sexe</th>
                <th>Numreo</th>
                <th>Age</th>
                <th>Adress</th>
                <th>Poids</th>
                <th>Pression Arterielle</th>
                <th>Symptome 1</th>
                <th>Symptome 2</th>
                <th>Symptome 3</th>
            </tr>

          {users.map((user, index) => (
            <tr key={index}>
              <td><div>{user.prenom}</div></td>
              <td><div>{user.nom}</div></td>
              <td><div>{user.sexe}</div></td>              
              <td><div>{user.age}</div></td>
              <td><div>{user.address}</div></td>
              <td><div>{user.poids}</div></td>
              <td><div>{user.pression_arterielle}</div></td>
              <td><div>{user.symptome_1}</div></td>
              <td><div>{user.symptome_1}</div></td>

            </tr>

        ))}
        </tbody>
        </table>



            {users.map((user) => (
                <div>
                    <div>{user.id}</div>
                    <div>{user.name}</div>
                    <div>{user.username}</div> 
                    <div>{user.email}</div> 
                    <div>{user.phone}</div> 
                </div>               
            ))}

            </div>
     )
}

    export default Liste;


































